export class VoucherreportingComponent extends ParentFinMgtComponent {
  constructor(apiService, authService, utilService, notifyService) {
    super(authService);
    this.apiService = apiService;
    this.authService = authService;
    this.utilService = utilService;
    this.notifyService = notifyService;
    this.dateFrom = '';
    this.dateTo = '';
    this.remarks = '';
    this.narration = '';
    this.voucherType = '';
    this.transactionType = '';
    this.branchCode = '';
    this.docNum = '';
    this.paymentList = [];
    this.branchCodeControl = new FormControl();
    this.isBranchLoading = false;
    this.payCodeTypeList = [];
    this.isLoading = false;
    this.filteredOptions = this.branchCodeControl.valueChanges.pipe(startWith(''), debounceTime(utilService.autoDelay()), distinctUntilChanged(), switchMap(val => {
      if (val.trim() !== '') this.isBranchLoading = true;
      return this.filter(val || '');
    }));
  }

  filter(val) {
    return this.apiService.getall(`branch/getSelectSysBranchList?search=${val.trim()}`).pipe(map(response => {
      const res = response; //if (res && res.length == 0)
      //  this.notifyService.showError("enter branch name")

      this.isBranchLoading = false;
      return res;
    }));
  }

  ngOnInit() {
    this.loadData();
  }

  loadData() {
    this.apiService.getall("paymentcodes/getSelectPaymentTypeList").subscribe(res => {
      if (res) this.payCodeTypeList = res;
    });
    this.apiService.getall("ledgerReport/accountVoucherPrint").subscribe(res => {
      if (res) this.paymentList = res;
    });
  }

  search() {
    this.isLoading = true;
    this.apiService.getall(`ledgerReport/accountVoucherPrint?voucherType=${this.voucherType}&narration=${this.narration}&remarks=${this.remarks}&transactionType=${this.transactionType}&from=${this.dateFrom ? this.utilService.getCommonDate(this.dateFrom) : ''}&to=${this.dateTo ? this.utilService.getCommonDate(this.dateTo) : ''}&branchCode=${this.branchCode}&docNum=${this.docNum}`).subscribe(res => {
      if (res) {
        this.isLoading = false;
        this.paymentList = res['list'];
        this.company = res['company'];
      }
    });
  }

  openPrint() {
    const printContent = document.getElementById("printcontainer");
    this.utilService.printForLocale(printContent);
  }

}

