        return this.apiService.getall(`branch/getSelectSysBranchList?search=${val.trim()}`)
            .pipe(map(response => {
            const res = response;
            //if (res && res.length == 0)
            //  this.notifyService.showError("enter branch name")
            this.isBranchLoading = false;
            return res;
        }));
    }
